USE master;
GO

IF DB_ID('CP2025') IS NOT NULL
BEGIN

    ALTER DATABASE CP2025 SET SINGLE_USER WITH ROLLBACK IMMEDIATE;

END;
GO

DROP DATABASE IF EXISTS CP2025;
GO

CREATE DATABASE CP2025;
GO

USE CP2025;
GO

/**

Scaricare il file AdventureWorks2022.bak da https://learn.microsoft.com/it-it/sql/samples/adventureworks-install-configure?view=sql-server-ver16&tabs=ssms

Effettuare il restore del file nel server locale

*/

IF NOT EXISTS (SELECT name FROM sys.schemas WHERE name = 'AW2022') EXEC ('CREATE SCHEMA AW2022 AUTHORIZATION dbo;');
GO

DROP TABLE IF EXISTS AW2022.Employee;
GO

WITH Employees
AS (
    SELECT
        E.BusinessEntityID,
        E.LoginID,
        CONVERT(NVARCHAR(20), E.OrganizationNode) AS OrganizationNode,
        E.OrganizationLevel,
        E.JobTitle,
        E.BirthDate,
        E.MaritalStatus,
        E.Gender,
        E.HireDate,
        E.VacationHours,
        E.SickLeaveHours,
        P.Title,
        P.FirstName,
        P.MiddleName,
        P.LastName,
        P.Suffix

    FROM AdventureWorks2022.HumanResources.Employee E
    INNER JOIN AdventureWorks2022.Person.Person P ON P.BusinessEntityID = E.BusinessEntityID
),
TableData
AS (
    SELECT
        --REVERSE(E.OrganizationNode),
        --CHARINDEX('/', REVERSE(E.OrganizationNode), 2),
        REVERSE(SUBSTRING(REVERSE(E.OrganizationNode), CHARINDEX('/', REVERSE(E.OrganizationNode), 2), LEN(E.OrganizationNode))) AS ManagerOrganizationNode,
        E.*

    FROM Employees E
)
SELECT
    E.BusinessEntityID,
    E.Title,
    E.FirstName,
    --E.MiddleName,
    E.LastName,
    E.Suffix,
    --E.ManagerOrganizationNode,
    COALESCE(M.BusinessEntityID, CASE WHEN LEN(E.OrganizationNode) = 3 THEN 1 ELSE NULL END) AS ManagerBusinessEntityID,
    E.LoginID,
    --E.OrganizationNode,
    --E.OrganizationLevel,
    E.JobTitle,
    E.BirthDate,
    E.MaritalStatus,
    E.Gender,
    E.HireDate,
    E.VacationHours,
    E.SickLeaveHours

INTO AW2022.Employee

FROM TableData E
LEFT JOIN TableData M ON M.OrganizationNode = E.ManagerOrganizationNode;
GO

IF NOT EXISTS (SELECT name FROM sys.schemas WHERE name = 'Dim') EXEC ('CREATE SCHEMA Dim AUTHORIZATION dbo;');
GO

IF NOT EXISTS (SELECT name FROM sys.schemas WHERE name = 'audit') EXEC ('CREATE SCHEMA audit AUTHORIZATION dbo;');
GO

/**

Scaricare e scompattare il file .zip da https://www.gardainformatica.it/database-comuni-italiani

Importare il file gi_province.csv in dbo.gi_province (sigla_provincia e denominazione_provincia)
Importare il file gi_comuni.csv in dbo.gi_comuni (codice_belfiore, codice_istat, denominazione_ita, sigla_provincia)

*/

DROP TABLE IF EXISTS dbo.gi_comuni;
GO

CREATE TABLE dbo.gi_comuni (
	sigla_provincia nvarchar(50) NOT NULL,
	codice_istat int NOT NULL,
	denominazione_ita_altra nvarchar(255) NOT NULL,
	denominazione_ita nvarchar(50) NOT NULL,
	denominazone_altra nvarchar(255) NULL,
	flag_capoluogo nvarchar(50) NOT NULL,
	codice_belfiore nvarchar(50) NOT NULL CONSTRAINT PK_gi_comuni PRIMARY KEY CLUSTERED,
	lat float NOT NULL,
	lon float NOT NULL,
	superficie_kmq float NOT NULL,
	codice_sovracomunale int NOT NULL
);
GO

DROP TABLE IF EXISTS dbo.gi_province;
GO

CREATE TABLE dbo.gi_province (
	codice_regione tinyint NOT NULL,
	sigla_provincia nvarchar(50) NOT NULL CONSTRAINT PK_gi_province PRIMARY KEY CLUSTERED,
	denominazione_provincia NVARCHAR(50) NOT NULL,
	tipologia_provincia nvarchar(50) NOT NULL,
	numero_comuni smallint NOT NULL,
	superficie_kmq float NOT NULL,
	codice_sovracomunale smallint NOT NULL
);
GO

