DROP TABLE IF EXISTS dbo.Comune; DROP TABLE IF EXISTS dbo.Provincia;
GO

IF OBJECT_ID('dbo.Provincia', 'U') IS NULL
BEGIN
    
    SELECT 
        sigla_provincia AS Id,
        denominazione_provincia AS Denominazione

    INTO dbo.Provincia

    FROM dbo.gi_province;

    ALTER TABLE dbo.Provincia ADD CONSTRAINT PK_Provincia PRIMARY KEY CLUSTERED (Id);

END;
GO

IF OBJECT_ID('dbo.Comune', 'U') IS NULL
BEGIN

    SELECT
        codice_belfiore AS Id,
        codice_istat AS IdIstat,
        denominazione_ita AS Denominazione,
        sigla_provincia AS IdProvincia,
        CONVERT(NVARCHAR(50), NULL) AS DenominazioneProvincia

    INTO dbo.Comune

    FROM dbo.gi_comuni;

    ALTER TABLE dbo.Comune ADD CONSTRAINT PK_Comune PRIMARY KEY CLUSTERED (Id);

    ALTER TABLE dbo.Comune ADD CONSTRAINT FK_Comune_IdProvincia FOREIGN KEY (IdProvincia) REFERENCES dbo.Provincia (Id);

    UPDATE C
    SET C.DenominazioneProvincia = P.Denominazione
    FROM dbo.Comune C
    INNER JOIN dbo.Provincia P ON P.Id = C.IdProvincia
    WHERE C.DenominazioneProvincia IS NULL;

END;
GO

